import React from 'react';
import { connect } from 'react-redux';
import { Link } from 'react-router-dom';
import ResumeSection from './ResumeSection';
import Paragraph from '../../typography/Paragraph';
import SkillsItemSection from './SkillsItemSection';
import SkillsItemSectionLabels from './SkillsItemSectionLabels';
import SkillsItem from './SkillsItem';

import { getRepositories } from '../../../actions';


class Resume extends React.Component {
  componentDidMount() {
    console.log('this.props =', this.props);
    if (this.props.repos?.length > 0) return;
    this.props.getRepositories();

  }


  render() {
    return (
      <section className="resume">
        <h2 className="heading heading--two">Resume</h2>
        <ResumeSection
          name="summary"
          headerSideContent={headerSideContent.summary}
        >
          {content.summary}
        </ResumeSection>
        <ResumeSection
          name="skills"
        >
          {content.skills}
        </ResumeSection>

        <ResumeSection
          name="work-history"
        >
          {content.workHistory}
        </ResumeSection>

        <ResumeSection
          name="education"
        >
          {content.education}
        </ResumeSection>
        <ResumeSection
          name="references"
        >
          {content.references}
        </ResumeSection>

        <ResumeSection
          name="certifications"
        >
          {content.certifications}
        </ResumeSection>
      </section>
    );
  }
}

const mapStateToProps = (state, ownProps) => {
  return {
    repos: state.repos,
  }
}

export default connect(mapStateToProps, {
  getRepositories,
})(Resume);
